import React from 'react'
import Box from "./Box"
import Grid from '@mui/material/Grid';


function Jobtitle({ jobs }) {
  return (
        <Grid container maxWidth="lg" spacing={2} 
            style={{ 
            display: 'flex', 
            alignItems: 'center',
            margin: '0 auto'
          }}
        >
          {jobs.slice(0, 5).map((job) => (
              <Grid item xs={12} sm={6} md={4} key={job.id}>               
                <Box job={job}/>            
              </Grid>
          ))}
        </Grid>
  )
}

export default Jobtitle
